import React from 'react'
import Json from './data.json'

function list(){
    const TampilData=Json.map(
        (data)=>{
            return(
                <tr>
                    <td>{data.product_id}</td>
                </tr>
            )
        }
    )

    return(
        <div>
            <table className="table table-striped">
                <thead>
                    <tr>
                        <th>Product ID</th>
                    </tr>
                </thead>
                <tbody>

                    {TampilData}
                </tbody>
            </table>
        </div>
    )
}


export default list
